result = []
n = 4

100.times do
  p draws << random[n]
  players.each_with_index do |player, index|
    player.each do |row|
      p row
      draws.each do |draw|
        p draw
        row.include?(draw) ? result << true : result << false
      end
      p result.tally
      if result.tally[true] == 5
        p "The player #{index + 1} has won !"
        winner = index
        winning_draws = draws
        p result
        p "_____________________"
        p "*********************"
        p "_____________________"
        winning_card = players[winner].first(5)
        p "Le croupier s'est arrêté avec les cartes suivantes : #{winning_draws}"

        winning_card = winning_card[0] + winning_card[1] + winning_card[2] + winning_card[3] + winning_card[4]

        p "La liste gagnante est #{winning_card}"

        winning_draws.each do |draw|
          winning_card.delete(draw)
        end

        p "Les éléments à sommer sont #{winning_card}"
        score = winning_card.sum
        p "La somme des éléménts non tirés est #{score} "

        p winning_draws.last
        final_result = score * winning_draws.last
        p "The final result is #{final_result} !!!"
        return result
      else
        result = []
        p "____________________________"
      end
    end
  end
  n +=1
end




